import ListItem from "./listItem"

const renderList = (item, display, page) => {
  let container = []
  let i = 0
  console.log(i+(100*page-100), 100*page)

  while (i+(100*page-100) < 100*page) {
    if (!item[i+(100*page-100)]) break
    container.push(item[i+(100*page-100)])
    i++
  }

  console.log(container)
  
  if (display) {
    return container.map((item, i) => (
      <ListItem
        key={`ID${i}D`}
        item1={item[0].data}
        item2={item[1].data}
        item3={item[2].data}
        item4={item[3].data}
        item5={item[4].data}
        item6={item[5].data}
      />
    ));
  }
};

export default renderList
